 // ];\n    // \n    // return new Observable(observer => {\n    //   setTimeout(() => {\n    //     observer.next(datosTemporales);\n    //     observer.complete();\n    //   }, 500);\n    // });\n  }\n\n  // Obtener tipos de combustible\n  obtenerTiposCombustible(): Observable {\n    return this.http.get(`${this.apiUrl}/tipos-combustible`).pipe(\n      map((response: any) => {\n        if (Array.isArray(response)) return response;\n        if (response && Array.isArray(response.data)) return response.data;\n        return [];\n      }),\n      catchError(this.handleError)\n    );\n    \n    // Datos de prueba temporales (comentados para usar backend real)\n    // const datosTemporales = [\n    //   { id: 1, nombre: 'Gasolina' },\n    //   { id: 2, nombre: 'Disel' },\n    //   { id: 3, nombre: 'Elctrico' },\n    //   { id: 4, nombre: 'Hbrido' },\n    //   { id: 5, nombre: 'Gas Natural' }\n    // ];\n    // \n    // return new Observable(observer => {\n    //   setTimeout(() => {\n    //     observer.next(datosTemporales);\n    //     observer.complete();\n    //   }, 500);\n    // });\n  }\n\n  // Agregar tipo de combustible\n  agregarTipoCombustible(tipo: any): Observable {\n    return this.http.post(`${this.apiUrl}/tipos-combustible`, tipo)\n      .pipe(\n        catchError(this.handleError)\n      );\n  }\n\n  // Eliminar tipo de combustible\n  eliminarTipoCombustible(id: number): Observable {\n    return this.http.delete(`${this.apiUrl}/tipos-combustible/${id}`)\n      .pipe(\n        catchError(this.handleError)\n      );\n  }\n\n  private handleError(error: any): Observable {\n    console.error('Error en catalogos service:', error);\n    return throwError(error);\n  }\n}\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/CombustibleService.html":{"url":"injectables/CombustibleService.html","title":"injectable - CombustibleService","body